import React from "react";

// Set the Weather API
const openWeatherKey = "fd3ee3aacf7b96f369c35f9b11b46187";
const weatherUrl = "https://api.openweathermap.org/data/2.5/weather";

// Page elements

const getWeather = async () => {
  console.log("Check");
  try {
    // Set the request url
    const location = "Vancouver";
    const urlToFetch = `${weatherUrl}?&q=${location}&APPID=${openWeatherKey}`;

    //Get the response
    const response = await fetch(urlToFetch);
    // Check the status of response
    if (response.ok) {
      const jsonResponse = await response.json();
      console.log(jsonResponse);
      return jsonResponse;
    }
  } catch (error) {
    console.log(error);
  }
};

function Home() {
  return (
    <>
        <main>
        <h1> Do you want to know a special menu only for today's weather?</h1>
            <form autocomplete="off">
                <button id ='button' type="submit">Go Check!</button>
            </form>
        </main>

      <div className="container">
        <h1> This is Home page</h1>
        <div id="destination"></div>
        <div className="sectiontitle">
          <h2>TODAY WEATHER</h2>
        </div>
        <section id="weather">
          <div className="weather" id="weater1"></div>
        </section>
      </div>
    </>
  );
}

export default Home;
